Este soneto es del poeta español Manuel del Palacio (1831-1906), conocido por sus poemas satíricos y amorosos durante el periodo del Romanticismo español. El poema en cuestión es "A una botella de vino añejo", que utiliza la metáfora de una botella de vino envejecido para hacer una comparación con una mujer madura.
